package com.jlt.vote.bis.vo;import java.io.Serializable;import java.util.Date;import java.util.List;/** * 活动详情 * @Author gaoyan * @Date: 2017/7/8 */public class CampaignDetailVo implements Serializable {	/**	 * 主办方主页图片	 */	private String sponsorPic;	/**	 * 报名数量     */	private Integer signCount;	/**	 * 投票数量     */	private Integer voteCount;	/**	 * 访问数量	 */	private Integer viewCount;	/**	 * 活动开始时间     */	private Date startTime;	/**	 * 主办方介绍	 */	private String sponsorIntro;	/**	 * 主办方地址	 */	private String sponsorAddress;	/**	 * 主办方电话	 */	private String sponsorMobile;	/**	 * 主办方图片列表	 */	private List<SponsorPicVo> sponsorPicUrls;	public String getSponsorPic() {		return sponsorPic;	}	public void setSponsorPic(String sponsorPic) {		this.sponsorPic = sponsorPic;	}	public Integer getSignCount() {		return signCount;	}	public void setSignCount(Integer signCount) {		this.signCount = signCount;	}	public Integer getVoteCount() {		return voteCount;	}	public void setVoteCount(Integer voteCount) {		this.voteCount = voteCount;	}	public Integer getViewCount() {		return viewCount;	}	public void setViewCount(Integer viewCount) {		this.viewCount = viewCount;	}	public Date getStartTime() {		return startTime;	}	public void setStartTime(Date startTime) {		this.startTime = startTime;	}	public String getSponsorIntro() {		return sponsorIntro;	}	public void setSponsorIntro(String sponsorIntro) {		this.sponsorIntro = sponsorIntro;	}	public String getSponsorAddress() {		return sponsorAddress;	}	public void setSponsorAddress(String sponsorAddress) {		this.sponsorAddress = sponsorAddress;	}	public String getSponsorMobile() {		return sponsorMobile;	}	public void setSponsorMobile(String sponsorMobile) {		this.sponsorMobile = sponsorMobile;	}	public List<SponsorPicVo> getSponsorPicUrls() {		return sponsorPicUrls;	}	public void setSponsorPicUrls(List<SponsorPicVo> sponsorPicUrls) {		this.sponsorPicUrls = sponsorPicUrls;	}}